import { NavLink } from 'react-router-dom'
import onelyLogo from '../images/onely-logo.png'


export default function Footer() {
  return (
    <footer>
      <div>
        <NavLink to='/'>
          <img src={onelyLogo} alt='onely logo' />
        </NavLink>
      </div>
    </footer>
  )
}
